<script>
    function sl(mls) {
        return new Promise(function (resolve, reject) {
            setTimeout(function () {
                resolve(true);
            }, mls);
        });
    }

    function isNumber(value) {
        return !isNaN(+value);
    }

    var transfer = new Vue({
        el: '.modal-transfer',
        delimiters: ["<%", "%>"],
        data: {
            direction: {
                from: [
                    {
                        'label': 'eJackpot',
                        'value': 'jackpot'
                    }
                ],
                to: [
                    {
                        'label': 'eWallet',
                        'value': 'main_wallet'
                    }
                ]
            },
            from: 'jackpot',
            to: 'main_wallet',
            currency: 'ETI',
            currency_data: [
                {
                    'value': 'ETI',
                    'html_content': "<div class='d-flex align-items-center'><img class='transfer-img' src='{{ asset('/assets/media/eticket.png') }}' /> <span class='ml-3'>ETI</span><span class='ml-2 text-muted'>ETicket</span></div>"
                },
                {
                    'value': 'EPO',
                    'html_content': "<div class='d-flex align-items-center'><img class='transfer-img' src='{{ asset('/assets/media/eticket.png') }}' /> <span class='ml-3'>EPO</span><span class='ml-2 text-muted'>EPoint</span></div>"
                },
                {
                    'value': 'EUSDT',
                    'html_content': "<div class='d-flex align-items-center'><img class='transfer-img' src='{{ asset('/assets/media/usdt.png') }}' /> <span class='ml-3'>USDT</span> <span class='ml-2 text-muted'>USDT</span></div>"
                }
            ],
            amount: 0,
            available_amount: 0
        },
        methods: {
            isNumber: function (evt) {
                evt = (evt) ? evt : window.event;
                var charCode = (evt.which) ? evt.which : evt.keyCode;
                if ((charCode > 31 && (charCode < 48 || charCode > 57)) && charCode !== 46) {
                    evt.preventDefault();
                } else {
                    return true;
                }
            },
            max: async function () {
                KTApp.block(".modal-transfer .modal-content", {});
                this.amount = (await axios.get('{{ route('client.user.balance') }}?to_number=true&currency=' + this.currency))['data'];
                setTimeout(function () {
                    KTApp.unblock(".modal-transfer .modal-content");
                }, 300);
            },
            handleTransfer: async function () {
                if (+this.amount <= +this.available_amount) {
                    if (this.from !== this.to && this.currency) {
                        if (isNumber(this.amount)) {
                            if (this.amount) {

                                KTApp.block(".modal-transfer .modal-content", {});

                                var result = (await axios.post('{{ route('client.user.post-withdraw')  }}', {
                                    currency: this.currency,
                                    amount: +this.amount
                                }))['data'];

                                if (result) {
                                    this.amount = 0;
                                    toastr.success('{{ __('label.success') }} !');

                                    setTimeout(function () {
                                        $(".modal-transfer").modal('hide');
                                        window.location.reload();
                                    }, 2000);
                                } else {
                                    toastr.error('{{ __('label.has_error') }} !');
                                }
                            } else {
                                toastr.error('{{ __('label.at_least_amount_transfer') }}');
                            }
                        } else {
                            toastr.error('{{ __('label.amount_must_be_number') }}');
                        }
                    } else {
                        toastr.error('{{ __('label.has_error') }}');
                    }
                } else {
                    toastr.error('{{ __('label.transfer_larger_than_balance') }}');
                }
            },
            changeCurrency: async function () {
                KTApp.block(".modal-transfer .modal-content", {});
                this.amount = 0;
                this.available_amount = (await axios.get('{{ route('client.user.balance') }}?to_number=true&currency=' + this.currency))['data'];
                setTimeout(function () {
                    KTApp.unblock(".modal-transfer .modal-content");
                }, 300);
            },
            changeCurrencyCall: async function (currency) {
                KTApp.block(".modal-transfer .modal-content", {});
                this.amount = 0;
                this.currency = currency;
                this.available_amount = (await axios.get('{{ route('client.user.balance') }}?to_number=true&currency=' + currency))['data'];
                setTimeout(function () {
                    KTApp.unblock(".modal-transfer .modal-content");
                }, 300);
            }
        },
        computed: {
            _available_amount: function () {
                var formatter = new Intl.NumberFormat('en-US', {
                    style: 'currency',
                    currency: 'USD',
                });

                var str = formatter.format(this.available_amount);
                return str.substring(1);
            }
        },
        created: async function () {
            await this.changeCurrency();
        }
    });

    $(".open-transfer-modal").click(function () {
        var currency = $(this).data('currency');
        setTimeout(function () {
            (async function () {
                await transfer.changeCurrencyCall(currency);
                $(".select-type-transfer").selectpicker('refresh');
            })();
        }, 200)
    });

